import React from "react";
import { Login } from "react-icons/bs";

const UserCard = ({ nombre, apellido }) => {
  return (
    <div
      className="fixed top-12 right-96 bg-white/60 rounded-lg shadow-lg p-4 m-4"
      style={{ zIndex: 3 }}
    >
      <div className="absolute top-0 right-0 bg-red w-8 h-8 transform rotate-45"></div>
      <h2 className=" text-3xl font-medium mb-2">Usuario</h2>
      <p className=" text-2xl font-normal font-[Dosis] text-gray-700 ">
        {nombre} {apellido}
      </p>
    </div>
  );
};

export default UserCard;
